import React from "react";
import topics from "./data/topics";

import Header from "./components/header";
import Footer from "./components/footer";
import Content from "./components/content";

const App = ({topics}) => {

  return (
    <>
      <Header links={topics} />
      <Content topics={topics} />
      <Footer />
    </>
  );
};

export default App;
